TITLE:
  - test membrane active strain material for gastric electromechanics
  - Here only the structural field is computed. The ssi problem is
  - solved by reading the result of the previous scatra simulation from the
  - restart file and computing the structural field only. Controlled
  - via option SCATRA_FROM_RESTART_FILE.
PROBLEM TYPE:
  PROBLEMTYPE: "Structure_Scalar_Interaction"
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "Statics"
  TIMESTEP: 0.1
  TOLDISP: 1e-06
  TOLRES: 1e-06
  LINEAR_SOLVER: 1
STRUCT NOX/Printing:
  Warning: false
  Inner Iteration: false
  Outer Iteration StatusTest: false
SCALAR TRANSPORT DYNAMIC:
  SOLVERTYPE: "nonlinear"
  VELOCITYFIELD: "Navier_Stokes"
  INITIALFIELD: "field_by_function"
  INITFUNCNO: 1
  LINEAR_SOLVER: 1
SSI CONTROL:
  RESTARTEVERY: 50
  NUMSTEP: 50
  MAXTIME: 5
  TIMESTEP: 0.1
  DIFFTIMESTEPSIZE: true
  ITEMAX: 5
  SCATRA_FROM_RESTART_FILE: true
  SCATRA_FILENAME: "framework_test_output/ssi_1wc_membrane_active_strain_scatra_only.dat-p2_for_ssi_1wc_membrane_active_strain_scatrafromrestart_vol_nonmatching.dat-p2-restart_step_0/xxx"
  FIELDCOUPLING: "volume_nonmatching"
  COUPALGO: ssi_OneWay_ScatraToSolid
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  EXPLPREDICT: true
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  STABTYPE: "no_stabilization"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
VOLMORTAR COUPLING:
  COUPLINGTYPE: "consint"
SOLVER 1:
  SOLVER: "UMFPACK"
  NAME: "Sca_Tra_Solver"
MATERIALS:
  - MAT: 1
    MAT_Membrane_ActiveStrain:
      MATIDPASSIVE: 2
      SCALIDVOLTAGE: 0
      DENS: 1
      BETA1: 10
      BETA2: 10
      VOLTHRESH: 0.25
      ALPHA1: 0.2
      ALPHA2: 0.2
  - MAT: 2
    MAT_Membrane_ElastHyper:
      NUMMAT: 1
      MATIDS: [3]
      DENS: 0.1
  - MAT: 3
    ELAST_IsoNeoHooke:
      MUE: 60
  - MAT: 11
    MAT_matlist_reactions:
      LOCAL: false
      NUMMAT: 3
      MATIDS: [12, 13, 14]
      NUMREAC: 3
      REACIDS: [110, 111, 112]
  - MAT: 12
    MAT_scatra:
      DIFFUSIVITY: 0
  - MAT: 13
    MAT_scatra:
      DIFFUSIVITY: 0
  - MAT: 14
    MAT_scatra:
      DIFFUSIVITY: 0
  - MAT: 110
    MAT_scatra_reaction:
      NUMSCAL: 3
      STOICH: [1, 0, 0]
      REACCOEFF: 1
      COUPLING: "simple_multiplicative"
      ROLE: [0, 1, 0]
  - MAT: 111
    MAT_scatra_reaction:
      NUMSCAL: 3
      STOICH: [0, 1, 0]
      REACCOEFF: 1
      COUPLING: "simple_multiplicative"
      ROLE: [0, 0, 1]
  - MAT: 112
    MAT_scatra_reaction:
      NUMSCAL: 3
      STOICH: [0, 0, 1]
      REACCOEFF: -12
      COUPLING: "simple_multiplicative"
      ROLE: [0, 1, 0]
CLONING MATERIAL MAP:
  - SRC_FIELD: "structure"
    SRC_MAT: 1
    TAR_FIELD: "scatra"
    TAR_MAT: 11
FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.795774715459477*(sin(x)*sin(y))"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.795774715459477*3*(cos(x+3*t)*sin(y+3*t)+sin(x+3*t)*cos(y+3*t))"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "(0.795774715459477*18)*(-sin(x+3*t)*sin(y+3*t)+cos(x+3*t)*cos(y+3*t))"
